import './App.css';
import Header from './components/common/Header';
import Footer from './components/common/Footer';
import headphone from '../../login/src/assets/img/headphone.png'

function App() {
  return (
    <div className="App">
      <Header />
      <div className='body'>
        <h1>Hello react</h1>
        <div>
        <div className='card'>
          <img src={headphone}  alt="headphone"  id='imm' />
          </div>
          <p>Price: 99.99$</p>
        </div>
        <button className='btn'>ADD TO CART</button>
      </div>
      <Footer />
    </div>
  );
}

export default App;
